import React, {Component} from 'react'

import {List,ListItem,ListItemText,Paper} from '@material-ui/core'

import Card from 'react-bootstrap/Card'
import CardDeck from 'react-bootstrap/CardDeck'
import Button from 'react-bootstrap/Button'
import ListGroup from 'react-bootstrap/ListGroup'
import ListGroupItem from 'react-bootstrap/ListGroupItem'

class Cart extends Component {
  createTask = item => {
    return (
      // <Paper style={{width:"100%", backgroundColor:"white", justifyContent:"center", padding :"20px", margin:"20px"}}>
      <div>
        <h2>{item.location}</h2>
        <div style={{display:"flex", flexDirection:"row",justifyContent:"space-between"}}>
          <div style={{textAlign:"left"}}>
            <h1>{item.name}</h1>
          </div>
          <div style={{textAlign:"right"}}>
            <h1>{item.price}</h1>
          </div>
        </div>
      </div>
      // </Paper>
    )
  }
  render() {
    const items = this.props.items
    const listItems = items.map(this.createTask)
    return (
      <Paper style={{backgroundColor:"pink", justifyContent:"center", display:"flex", flexDirection:"column", margin:"50px", padding:"50px"}}>
        <h1>Cart</h1>
        <div>{listItems}</div>
      </Paper>
    )
  }
}

export default Cart
